import { DefaultTheme } from "react-native-paper";

export const theme = {
  ...DefaultTheme,
  colors: {
    ...DefaultTheme.colors,
    primary: "#6a5cff",
    secondary: "#FFF",
    error: "#f13a59",
    success: "#00B386"
  }
};
